    return (
        <div key={props.key} className="input-group mb-3">
            <Button onClick={() => props.addNumber}>+{props.key}</Button>
            <span class="input-group-text">{props.currentAmmount}</span>
            <Button onClick={() => props.lessenNumber}>-{props.key}</Button>
